type ResponseFor<TResponses, TCode extends number> =
  TCode extends keyof TResponses
    ? TResponses[TCode]
    : `${TCode}` extends keyof TResponses
      ? TResponses[`${TCode}`]
      : never;

type JsonBody<TResponse> = TResponse extends { content: { 'application/json': infer TBody } } ? TBody : never;

